import Header from '../Header';
import SideNavBar from '../SideNavBar';

import '../../css/common.css';
import DisplayWindow from './DisplayWindow';
import { useEffect } from 'react';

import {baseURL} from '../../sourceData/data';

export default function Index() {


  async function FetchAdmins() {


    useEffect(() => {
      fetch(`${baseURL}/admins`, {
        method: 'GET',
      })
        .then((response) => response.json())
        .then((resp) => {

          console.log("admins")
          console.log(resp)

          // setAdminList(resp);
          // setSelectedAdminList(resp);
        });

        fetch(`${baseURL}/branches`, {
          method: 'GET',
        })
          .then((response) => response.json())
          .then((resp) => {

            console.log("branches")
            console.log(resp)
            // setBranchesList(resp);
            // setSelectedBranchesList(resp);
          });

          fetch(`${baseURL}/clients`, {
            method: 'GET',
          })
            .then((response) => response.json())
            .then((resp) => {

            console.log("clients")
            console.log(resp)
              // setClientList(resp);
              // setSelectedClientList(resp);
            });

            fetch(
              `${baseURL}/overviews`,
              {
                method: 'GET',
              }
            )
              .then((response) => response.json())
              .then((resp) => {

                console.log("clients")
            console.log(resp)
                // setOverviewData(resp)
              });


    }, []);




  }

  FetchAdmins();

  setInterval(() => {
    FetchAdmins();
  }, 60000);




  return (
    <div>
      <Header />
      <div className="container-fluid row float-start ">
        <SideNavBar />
        <div class="container-fluid col-10 " id="displayWindow">
          <DisplayWindow />
        </div>
      </div>
    </div>
  );
}
